-- View structure for `influxiq_vw_affiliatehit_details`
-- ----------------------------
DROP VIEW IF EXISTS `influxiq_vw_affiliatehit_details`;
CREATE VIEW `influxiq_vw_affiliatehit_details` AS select `influxiq_affiliation_details`.`i_aff_id` AS `i_aff_id`,`influxiq_affiliation_details`.`s_aff_name` AS `s_aff_name`,`influxiq_affiliation_details`.`t_aff_time` AS `t_aff_time`,`influxiq_affiliation_details`.`s_aff_url` AS `s_aff_url`,`influxiq_affiliation_details`.`i_active` AS `i_active`,`influxiq_affliationhit_details`.`i_affhit_id` AS `i_affhit_id`,`influxiq_affliationhit_details`.`t_affhit_time` AS `t_affhit_time`,`influxiq_affliationhit_details`.`s_affhit_ip` AS `s_affhit_ip`,`influxiq_affliationhit_details`.`is_active` AS `is_active`,`influxiq_affliationhit_details`.`s_aff_type` AS `s_aff_type` from (`influxiq_affiliation_details` join `influxiq_affliationhit_details`) where (`influxiq_affiliation_details`.`i_aff_id` = `influxiq_affliationhit_details`.`i_aff_id`) ;

-- ----------------------------
-- View structure for `influxiq_vw_product_details1`
-- ----------------------------
DROP VIEW IF EXISTS `influxiq_vw_product_details1`;
CREATE VIEW `influxiq_vw_product_details1` AS select `influxiq_product`.`id` AS `id`,`influxiq_product`.`name` AS `name`,`influxiq_category`.`id` AS `cat_id`,`influxiq_category`.`cat_name` AS `cat_name`,`influxiq_product`.`description` AS `description`,`influxiq_product`.`contract` AS `contract`,`influxiq_product`.`feature` AS `feature`,`influxiq_product`.`price` AS `price`,`influxiq_product`.`insall_charge` AS `insall_charge`,`influxiq_product`.`platform_cost` AS `platform_cost`,`influxiq_product`.`transaction_charge` AS `transaction_charge`,`influxiq_product`.`codeonly_price` AS `codeonly_price`,`influxiq_product`.`page_range` AS `page_range`,`influxiq_product`.`image` AS `image`,`influxiq_product_feature`.`value` AS `feature_value`,`influxiq_product_package`.`id` AS `package_id`,`influxiq_product_package`.`duration` AS `package_duration`,`influxiq_product_package`.`price` AS `package_price`,`influxiq_product_package`.`status` AS `package_status`,`influxiq_product`.`prodnum` AS `package_no` from (((`influxiq_product` left join `influxiq_product_feature` on((`influxiq_product`.`id` = `influxiq_product_feature`.`product_id`))) left join `influxiq_product_package` on((`influxiq_product`.`id` = `influxiq_product_package`.`product_id`))) join `influxiq_category` on((`influxiq_product`.`category_id` = `influxiq_category`.`id`))) ;

-- ----------------------------
-- Procedure structure for `itpl_sp_authenticate_user`
-- ----------------------------
DROP PROCEDURE IF EXISTS `itpl_sp_authenticate_user`;
DELIMITER ;;
CREATE PROCEDURE `itpl_sp_authenticate_user`(IN `s_uname` varchar(250), IN `s_pass` varchar(250))
BEGIN
  DECLARE i_id INT;

 SELECT IFNULL(vu.`id`, 0) AS id
 FROM influxiq_vw_user_details AS vu 
 WHERE vu.`s_username` = s_uname 
 AND vu.`s_password` = s_pass AND vu.i_active=1 LIMIT 1
 INTO i_id;
  IF(i_id > 0) THEN UPDATE influxiq_user_details AS ud SET ud.`t_logout_time`=now() WHERE ud.id = i_id ;
  END IF;
  IF(i_id > 0) THEN SELECT vu.*, '0' AS 'error', GROUP_CONCAT(`s_role_name`) as s_roles, GROUP_CONCAT(`i_user_role`) as i_roles FROM influxiq_vw_user_details AS vu WHERE vu.id = i_id GROUP BY vu.id;
    ELSE SELECT '1' AS 'error' FROM DUAL;
 END IF;

END
;;
DELIMITER ;
