on Locked=&quot;false&quot; Priority=&quot;47&quot; Name=&quot;List Table 2 Accent 6&quot; /&gt;\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;48&quot; Name=&quot;List Table 3 Accent 6&quot; /&gt;\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;49&quot; Name=&quot;List Table 4 Accent 6&quot; /&gt;\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;50&quot; Name=&quot;List Table 5 Dark Accent 6&quot; /&gt;\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;51&quot;\nName=&quot;List Table 6 Colorful Accent 6&quot; /&gt;\n&lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;52&quot;\nName=&quot;List Table 7 Colorful Accent 6&quot; /&gt;\n&lt;/w:LatentStyles&gt;\n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!--[if gte mso 10]&gt;\n&lt;style&gt;\n/* Style Definitions */\ntable.MsoNormalTable\n{mso-style-name:&quot;Table Normal&quot;;\nmso-tstyle-rowband-size:0;\nmso-tstyle-colband-size:0;\nmso-style-noshow:yes;\nmso-style-priority:99;\nmso-style-parent:&quot;&quot;;\nmso-padding-alt:0in 5.4pt 0in 5.4pt;\nmso-para-margin:0in;\nmso-para-margin-bottom:.0001pt;\nmso-pagination:widow-orphan;\nfont-size:10.0pt;\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;}\n&lt;/style&gt;\n&lt;![endif]--&gt;', '&lt;p&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;\nline-height:115%;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;Languages&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black;\nmso-bidi-font-weight:bold&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black;\nmso-bidi-font-weight:bold&quot;&gt;Our technology is written in a combination of PHP, various other web languages (XML, Soap, AJAX) and Action Script (flash code base) on a MySQL database structure.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;Our choice of language is based on flexibility, usability and a very strong existing code library that we have developed over time.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;InfluxIQ Dev Grp 2 Year Limited Warranty&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;If your application fails to perform the specifications outlined in this contract, we will investigate the conditions which led up to the problem(s) of concern. If it&#039;s determined that the conditions which created the issue were directly related to the software/web development performed by InfluxIQ Dev Grp we will remedy the issues as quickly as possible.&lt;/span&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;Forthwith there are certain conditions such as choice of database structure, pre-existing code, service of the host, server attacks, moving the software away from installation point and other potential factors that may be determined by us to be in breach of this warranty. As a condition of this warranty no other party outside of assigned InfluxIQ Dev Grp staff may alter, access or move the code or software in any way without consultation and permission from InfluxIQ Dev Grp&amp;rsquo;s executive staff. In the instance of such a violation, the warranty is void immediately.&lt;/span&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;Our warranty covers all of our custom frame work development.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;All additional software that is integrated as third party solutions do not fall under this warranty.&lt;/span&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;Refund Policy&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;InfluxIQ Dev Grp does not generally offer refunds. However, because we value our customer&#039;s satisfaction, if a customer feels that an InfluxIQ Dev Grp product or service has excessively failed their expectations then they may contact us via email for individual consideration of a full or partial refund. As a convenience InfluxIQ Dev Grp offers the ability to use credit and debit cards for smaller payments toward products and services rendered.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;By signing this agreement client agrees not to charge back their payments to InfluxIQ Dev Grp and instead to work with InfluxIQ Dev Grp on arrangements for refund if one is offered.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;Refunds are fully left to the discretion of InfluxIQ Dev Grp.&lt;/span&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;Projected Project Hours, Timeframe and Deadlines&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;Software and website development and distribution deadlines are meant to be a guideline, and we fully intend to meet all deadlines quoted to our customers. Due to the nature of custom agile development, timeframes can be compromised by unforeseen events or new client requests in the design and engineering process.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;We want our clients to have creative freedom to take the project in any direction they choose. However, keep in mind that requests made by you outside of this proposal, or third-party involvement, can add additional time and cost to the platform. Features that are listed may, as a result, go over estimated project hours if the client decides to take the project development in a new direction. &lt;/span&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;We fully understand our client&amp;rsquo;s have deadlines surrounding funding and marketing objectives for delivery of their product. We do everything we can to match our development speed and delivery to these deadlines. In the software industry unrealistic deadlines can result in a poor quality of software and therefore on occasion we will extend deadlines to assure that high quality and usable products are produced from our projects. We do not guarantee that project completion will occur by the quoted deadline or estimated project hours.&lt;/span&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:\n&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;Custom Development&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;All custom development is billed hourly based on the current pricing found on our website.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;Due to the nature of custom development, we offer our clients incremental reporting on their projects.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;All of the engineering we do is well documented and submitted with our invoicing.&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;Hours spent in client meetings, coding, debugging, testing and installing a customized platform are all considered billable hours. (Product platform installation is included in product price.)&lt;/span&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p style=&quot;mso-layout-grid-align:none;text-autospace:none&quot; class=&quot;MsoNormal&quot;&gt;&lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:\n&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;Ownership&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;\ncolor:black&quot;&gt;Client is receiving an unlimited license to possess and use the software platform developed by InfluxIQ Dev Grp as they see fit within the constraints of their own enterprise. Client may sell their business and the platform along with it, valuing the software application with that purchase, but may not simply replicate the code structure and begin selling the code base as a product or duplicate it for any other purpose other than backup without further contracting with InfluxIQ Dev Grp. The code base and modules used to develop the client&amp;rsquo;s project are part of the InfluxIQ Dev Grp core framework and rights are retained by InfluxIQ Dev Grp and their developers. Client agrees to allow InfluxIQ Dev Grp to use their project in marketing efforts including but not limited to samples, case studies, in their portfolio, or other locations. InfluxIQ Dev Grp may also include a small label on the work they have performed.&lt;/span&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;Entire Agreement&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;\ncolor:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;\ncolor:black&quot;&gt;This agreement contains the entire understanding of the parties and supersedes any and all previous verbal and written agreement or understandings. There are no other agreements, representations or warranties not set forth in this agreement. This agreement will bind, and inure to the benefit of, the parties and their respective successor and assigns. Any modification, amendment, or waiver of any provision of this agreement may be made only in writing and signed by both parties. The failure by any party to exercise any rights granted herein upon the occurrence of any event set forth in this agreement shall not constitute a waiver of any such rights upon the occurrence of any such event. In the event any provision of this agreement is held to be in violation of any law, statue, regulation, ordinance, or court order, this agreement shall be deemed modified accordingly and to the extent necessary to comply therewith and shall otherwise continue full force and effect. This agreement shall be governed by, and construed in accordance with, the laws of the State of Idaho, and any action, claim or proceeding under this agreement shall be commenced exclusively in the federal or state courts located in the State of Idaho. This agreement may be executed in several counterparts, each of which shall constitute one and the same instrument. Section or paragraph headings in the agreement are for convenience of reference only.&lt;/span&gt;&lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\n&lt;p class=&quot;MsoPlainText&quot;&gt;&lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;color:black&quot;&gt;Arbitration Provision&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;quot;;\ncolor:black&quot;&gt;&lt;br /&gt;\n&lt;/span&gt;&lt;/p&gt;\n&lt;p class=&quot;MsoPlainText&quot;&gt;&lt;span style=&quot;font-size:10.0pt;font-family:&amp;quot;Arial&amp;quot;,&amp;quot;sans-serif&amp;