Research and Optimization of keywords to ensure field-relevant and subject-appropriate content, resulting in maximum utilization of Search Engine keyword targeting&lt;/li&gt;\n&lt;li&gt;Title-Tag Optimization- Refined and effective structuring of title-tags, ensuring optimal relation to subject-matter.&lt;/li&gt;\n&lt;li&gt;Meta-Description Optimization- HTML attribute customization, providing concise explanations of webpage content.&lt;/li&gt;\n&lt;li&gt;Images Optimization- Compression and resizing (if needed) for website Images to ensure proper display within search engines.&lt;/li&gt;\n&lt;li&gt;URL Rewriting (Where Applicable)- This feature, when needed, provides restructuring of a web URL&amp;rsquo;s appearance. This ensures more relevant-looking links to web pages.&lt;/li&gt;\n&lt;li&gt;W3C Compliance Checking- Ensures that HTML and CSS code that comprises client&amp;rsquo;s website structure is compliant with standards set by the World Wide Web (W3) Consortium (C) &amp;ndash; W3C&lt;/li&gt;\n&lt;li&gt;Broken Links Checks- Checks for missing images and broken links (HTML), missing background graphics (CSS), movie files (Flash), RSS feeds, ASP/ASPX/PHP errors/warnings (Script Errors) and configuration, expired domains, and faulty SSL certificate (Plus).&lt;/li&gt;\n&lt;li&gt;HTML Error Checks- Identification of errors within pages or links, as well as short or missing titles, and duplicate meta-tags.&lt;/li&gt;\n&lt;li&gt;Content Fixing Suggestions- Suggestions for corrections in content in order to provide higher levels of search engine preference as well as visitor approval.&lt;/li&gt;\n&lt;/ul&gt;\n&lt;/li&gt;\n&lt;/ul&gt;', '3', '1', '1');
