INSERT INTO `influxiq_product_feature` VALUES ('659', '30', 'Customers are able to create accounts, sign up for product updates and view any of their purchases and past invoices at any time.');
INSERT INTO `influxiq_product_feature` VALUES ('660', '30', 'Numerous additional features, each expanding further upon those found within Business Standard and Shop Express. Some of these additional features include the ability to set special pricing, feature products on the homepage, suggest products during purchase (UpSell), and add products as attributes to other products.');
INSERT INTO `influxiq_product_feature` VALUES ('657', '30', 'Functionality for your website to support International currency, providing you with the ability to market to a global economy. Ability to convert currency directly within the check-out process, allowing global visitors to display item costs in their own currency.');
INSERT INTO `influxiq_product_feature` VALUES ('658', '30', 'Ability for customers to add items to their wish list(s), rate products that they have purchased from the website and, if allowed, make comments on purchased items.');
INSERT INTO `influxiq_product_feature` VALUES ('542', '53', 'This system provide a faq management with question and answer that can be asked by any client.');
INSERT INTO `influxiq_product_feature` VALUES ('698', '15', 'Ability to publish your products to more than 20 different online web aggregate sites including Craig\'sList, Google Product Search, and Google Base. Through this methodology, you receive additional marketing power per product.');
INSERT INTO `influxiq_product_feature` VALUES ('695', '15', 'All features and services contained within the Business Standard, Shop Express, and Shop Deluxe Platforms. This Platform is our advanced eCommerce web-enterprise edition.');
INSERT INTO `influxiq_product_feature` VALUES ('696', '15', 'Funnel System, a must-have feature for any company looking to capture the attention of a visitor through a paid search or affiliate advertising endeavor. This Funnel is a media presentation, beginning with a landing page, stepping through to incentives and ultimate resulting in an item-purchase or lead-capture.');
INSERT INTO `influxiq_product_feature` VALUES ('697', '15', '3 Custom Landing Pages that work through our lead-system, bringing you potential customers based on specific and powerful inbound marketing methods. These landing pages can be a sub-set of your URL, or they can posess their own unique URL.');
INSERT INTO `influxiq_product_feature` VALUES ('709', '1', 'Affiliates may create marketing campaigns, make banners to display their association with you, and create links that allow them to go out and market your products and services directly.');
