INSERT INTO `influxiq_product_feature` VALUES ('710', '1', 'Replicate-able website functionality for each affiliate to send their audience to a customized webpage. Ownership of the website remains yours, but it has many unique parts specific to each affiliate.');
INSERT INTO `influxiq_product_feature` VALUES ('708', '1', 'Back-office where affiliates may log in and interact with administrators as well as view a variety of tools and reports.');
INSERT INTO `influxiq_product_feature` VALUES ('706', '1', 'All features and services contained within the Business Standard, Shop Express, Shop Deluxe, and Market Launch Platforms. This is our premium eCommerce web enterprise edition.');
INSERT INTO `influxiq_product_feature` VALUES ('707', '1', 'Create and maintain an affiliate program that goes up to 3 levels deep. Control directly from the management portal, changing percentages as deemed necessary.');
INSERT INTO `influxiq_product_feature` VALUES ('483', '41', 'Technology specifically developed to include all expected and required social networking features. Sophisticated features, offering the same caliber of functionality as popular websites like Facebook and Twitter.');
INSERT INTO `influxiq_product_feature` VALUES ('479', '41', 'May be added to any of our other Platforms. This offers incredible additional value to our MLM and Affiliate Platforms.');
INSERT INTO `influxiq_product_feature` VALUES ('480', '41', 'Private and public pages, fully integrated with our intelligent page-creation system, resulting in optimal search engine placement.');
INSERT INTO `influxiq_product_feature` VALUES ('481', '41', 'Each member may add friends, chat, blog, add photos, add video and join groups and forums. You control how this works for your proprietary system and can grant or deny any of these features.');
INSERT INTO `influxiq_product_feature` VALUES ('482', '41', 'Administrators may send out newsletters, manage black-list(s) for inappropriate activities/actions, ban users and, if necessary, approve content before being publicly displayed.');
INSERT INTO `influxiq_product_feature` VALUES ('635', '32', 'Custom webpage editor, providing easy access to editable pages of one\'s website.');
INSERT INTO `influxiq_product_feature` VALUES ('634', '32', 'The ability to easily create or modify new and existing webpages, providing you control over additional content beyond that of the original design. This access is provided by a simple yet secure login, greatly enhancing your content via a user-friendly management portal.');
INSERT INTO `influxiq_product_feature` VALUES ('633', '32', 'Create content using your website\'s blog, sharing your posts through an RSS feed as well as a variety of social media sites including Facebook, Twitter, and Google+.');
INSERT INTO `influxiq_product_feature` VALUES ('687', '31', 'Connect your cart to whichever merchant service you desire for your business.  We are particularly familiar with Authorize.net, PayPal and several other services.');
INSERT INTO `influxiq_product_feature` VALUES ('686', '31', 'Shopping Basket complete with functionality to allow visitors to select their desired products and continue browsing the website, allowing them to select other products before continuing through the check-out process.');
INSERT INTO `influxiq_product_feature` VALUES ('684', '31', 'Product Library and Product View options to allow website visitors to easily browse through products on your website.');
INSERT INTO `influxiq_product_feature` VALUES ('685', '31', 'Each product may display a virtually unlimited number of pictures, showcasing the ability to display an image gallery directly on the product-view page.');
INSERT INTO `influxiq_product_feature` VALUES ('544', '53', 'Great medium of communication with all the clients in a glance.');
