INSERT INTO `influxiq_product_feature` VALUES ('525', '42', 'All required features of a distributor back-office. This includes graphic entry, training system(s), and access to more sophisticated lead management.');
INSERT INTO `influxiq_product_feature` VALUES ('526', '42', 'Binary or Uni-Level compensation plans. Consulting available upon request.');
INSERT INTO `influxiq_product_feature` VALUES ('527', '42', 'Lead-Store allowing for retail customers to become distributors. This feature is unique to our CRM Platform, and is very lucrative for managing online marketing campaigns resulting in generated sales.');
INSERT INTO `influxiq_product_feature` VALUES ('543', '53', 'All features and services contained within the Global Standard, Blog,Article,Pressrelease,News,Cases. This is one of our most powerful marketing Platform. ');
